.right-box {
  background: #fff;
  .center-tabs {
    >>> .el-tabs__header {
      margin-bottom: 0 !important;
    }
    >>> .el-tabs__nav {
      width: 100%;
    }
    >>> .el-tabs__item {
      width: 50%;
      text-align: center;
    }
  }
  >>> .el-scrollbar__view {
    padding: 0 15px 15px;
    .el-input-number,
    .el-select,
    .el-cascader {
      width: 100%;
    }
    .el-slider {
      margin-right: 10px;
    }
  }
  .portal-attr {
    margin-top: 15px;
  }
}

>>> .el-collapse-item__content {
  padding-bottom: unset !important;
}
>>> .el-radio-button__inner {
  padding: 9px !important;
  min-width: 55px;
}
>>> .select-item,
.select-item {
  display: flex;
  border: 1px dashed #fff;
  box-sizing: border-box;
  &.el-input + .el-input {
    margin-left: 4px;
  }
  & + .select-item {
    margin-top: 4px;
  }
  &.sortable-chosen {
    border: 1px dashed #409eff;
  }
  .select-line-icon {
    line-height: 32px;
    font-size: 22px;
    padding: 0 4px;
    color: #606266;
    .icon-ym-darg {
      font-size: 20px;
      line-height: 31px;
      display: inline-block;
    }
  }
  .close-btn {
    cursor: pointer;
    color: #f56c6c;
  }
  .option-drag {
    cursor: move;
  }
}
